import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { SidebarComponent } from './Components/sidebar/sidebar.component';
import { HeaderComponent } from './Components/header/header.component';
import { FooterComponent } from './Components/footer/footer.component';
import { HomeComponent } from './Components/home/home.component';
import { MainPageComponent } from './Modules/PfeSpace/main-page/main-page.component';
import { ContainerComponent } from './Components/container/container.component';
import { CourseComponent } from './Modules/Courses/course/course.component';
import { FormsModule } from '@angular/forms';
import { AjoutFormationComponent } from './Modules/Courses/ajout-formation/ajout-formation.component';
import { HttpClientModule } from '@angular/common/http';
import { CourseService } from './Modules/Courses/courses.service';

@NgModule({
  declarations: [
    AppComponent,
    SidebarComponent,
    HeaderComponent,
    FooterComponent,
    HomeComponent,
    MainPageComponent,
    ContainerComponent,
    CourseComponent,
    AjoutFormationComponent,
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    FormsModule,
    HttpClientModule
  ],
  providers: [CourseService],  // Add CourseService here, not in declarations
  bootstrap: [AppComponent]
})
export class AppModule { }
